import React from 'react';
import '../index.css';

function PostsBlog(){

    return(
        <div className='postscontainer'>
            <ul>
                <li>
                    <h1>Theme1</h1>
                    <p>Title1</p>
                </li>
                <li>
                    <h1>Theme2</h1>
                    <p>Title2</p>
                </li>
                <li>
                    <h1>Theme3</h1>
                    <p>Title3</p>
                </li>
                
            
            </ul>
        </div>
    );
}


export default PostsBlog;
